// And groups predicates with the AND operator between them.
func And(predicates ...predicate.JobTemplate) predicate.JobTemplate {
	return predicate.JobTemplate(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.JobTemplate) predicate.JobTemplate {
	return predicate.JobTemplate(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.JobTemplate) predicate.JobTemplate {
	return predicate.JobTemplate(sql.NotPredicates(p))
}
